import React from 'react'

const Category = () => {
    const categorys = [
        "category1",
        "category2",
        "category3",
        "category4",
        "category5",
        "category6",
        "category7",
        "category8",
        "category9",
        "category10",

    ]
  return (
    <div style={{width:"100%",padding:"10px 100px",overflow:"auto"}}>
        <div style={{display:"flex", justifyContent:"flex-start", alignItems:"center",flexWrap:"nowrap",gap:"10px"}}>
            {
                categorys.map((category) => {
                    return (
                        <article>{category}</article>
                    )
                })
            }
        </div>
    </div>
  )
}

export default Category
